import React, { Component } from 'react';
import styled from 'styled-components'
import { Container, Row, Col } from 'reactstrap';

const Head = styled.h1`
  margin-bottom: 3%;
  margin-top: 10%;
  font-size: 55px;
  font-weight: bold;
  line-height: 1.35;
  color: #69302c;
`

const Sub = styled.p`
  font-size: 24px;
  font-weight: 500;
  color: #69302c;
`
const SubText = styled.div`
  font-size: 21px;
  cursor: pointer;
  color: #69302c;
  margin: 0px;
  &:hover {
    color: #69302c;
    text-decoration: none;
  }
`
const Button = styled.button`
    cursor: pointer;
    background-color:#69302c;
    border:0px solid transparent;
    border-radius: 3px;
    color: #fff;
    padding: 0.4em 1.25em;
    font-size: 21px;
    width: auto;
    margin: 0px;
    &:hover {
    color: #69302c;
    text-decoration: none;
  }
`
const Hover = styled.a`
  cursor: pointer;
  color: #69302c;
  margin: 0px;
  text-decoration: none;
  &:hover {
    color: #69302c;

  }
`
class App extends Component {
    render() {
        return (
            <Container>
            <Row>
              <Col>
          <Head>
            ถ้าพูดเยอะอาจจะเจ็บคอ<br />
            แต่ถ้ามา Talk n' Chip 2019<br />
            แล้วพูดไม่พอจะเสียใจ
          </Head>
          <Sub>23 กุมพาพันธ์ 2019 ณ มหาวิทยาลัยเทคโนโลยีพระจอมเกล้าธนบุรี อาคารเรียนรวม 2 ชั้น 4 ห้อง 2401 และ 2402</Sub>
          </Col>
      </Row>
      <Row>
      <Col xs={12} md={5} lg={3} className='m-0'>
            <Button block>ส่งหัวข้อที่จะไปพูดกันเลย !</Button>
            </Col>
        <Col xs={12} md={7} lg={9} className='py-2 mt-1 my-0 pl-1'>
          <SubText>
            <span className='mx-3'>หรือ</span>
            <Hover>ดูหัวข้อที่น่าสนใจ></Hover>
          </SubText>
        </Col>
      </Row>
    </Container>
                    );
                  }
                }
export default App
